import React, { Fragment } from 'react';

const Index = () => (
  <Fragment>
    <div id="content">
      hi
    </div>
    <style jsx>
      {`
        #content {
          height:300px;
          background-color:#fafafa;
        }
      `}
    </style>
  </Fragment>
);

export default Index;
